import React from 'react';
import { useReducer } from 'react';

const UseReducer = () => {

    const INITIAL_STATE = {
        loading: false,
        post: {},
        error: false
    }

    const useReducer = (state, action) => {

        switch(action.type) {
            case "FETCH_START": return {
                ...state,
                loading: true,
            };
            case "FETCH_SUCCESS":  return {
               ...state,
                post:action.payload,
            };
            case "FETCH_ERROR":  return {
                ...state,
                error: true
            }
            default:
                return state
        }

    }





  return (
    <div>UseReducer</div>
  )
}

